QUOTE
Sirenia is a gothic metal band from Stavanger, Norway which incorporates a mixture of gothic metal and symphonic metal, as well as extreme metal and death metal elements. The vocals consist of death grunts, operatic female vocals and a clean male singer. The lyrics, written by Morten Veland, tell a loose conceptual story that began at Widow&amp;#039;s Weeds, while he was still a member of Tristania.

The band uses melodic instrumentals, synthesizers, and distorted guitars with female vocals, male death vocals, clean male vocals, a choir, and violins. The lyrics are concerned with human existence, emotion, and mental states.
